IF OBJECT_ID('dbo.proc_transform_204', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_204;
GO
CREATE PROCEDURE dbo.proc_transform_204
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_204
    SET payload = LEFT(payload, 1000) + N'|V4-204|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_204;
END
GO
IF OBJECT_ID('dbo.audit_v4_204', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_204 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_204;
GO

CREATE INDEX IDX_staging_204_payload ON dbo.staging_table_204 (id);
GO
EXEC sp_updatestats;
